  let token2terminal : token -> int =
    fun _tok ->
      match _tok with
      | AMPERAMPER ->
          129
      | AMPERSAND ->
          128
      | AND ->
          127
      | AS ->
          126
      | ASSERT ->
          125
      | BACKQUOTE ->
          124
      | BANG ->
          123
      | BAR ->
          122
      | BARBAR ->
          121
      | BARRBRACKET ->
          120
      | BEGIN ->
          119
      | CHAR _ ->
          118
      | CLASS ->
          117
      | COLON ->
          116
      | COLONCOLON ->
          115
      | COLONEQUAL ->
          114
      | COLONGREATER ->
          113
      | COMMA ->
          112
      | COMMENT _ ->
          111
      | CONSTRAINT ->
          110
      | DO ->
          109
      | DOCSTRING _ ->
          108
      | DONE ->
          107
